{'pk': 17874865744703552, 'user_id': 4801845517, 'text': 'El nudo materno de Jane Lazarre
Un libro que tuvo su primera edición en 1976 cuando la cuestión alrededor de la mujer y la maternidad no formaban parte de la agenda ni siquiera del feminismo, combinación de ensayo y ficción. Su marido es un hombre de color por lo que el hijo 
de ambos es también el resultado de una unión política, un matrimonio interracial que encuentra las puertas cerradas tanto en la comunidad Blanca como en la negra. 
@las_afueras
@leemosbigsurarg 
#lasafueras #literaturanorteamericana
#literaturafeminista 
